"use strict";

$(function () {
  $("#btnShowPopup0").click(function () {
    var title = "Greetings";
    var body = "Welcome to ASPSnippets.com";
    $("#MyPopup0 .modal-title").html(title);
    $("#MyPopup0 .modal-body").html(body);
    $("#MyPopup0").modal("show");
  });
});
